        let m = time.getMonth() + 1
        let t = m + '-' + time.getDate() + ' ' + time.getHours() + ':' + time.getMinutes()
        this.material.classblock.push({
          'name': '刘朝阳',
          'headimg': 'data:image/jpeg;base64,',
          'text': this.talktext,
          'time': t
        })
        this.showdebate = -1
        document.getElementsByClassName('talk-input')[0].focus()
        this.talktext = ''
        let i = 0
        this.$nextTick(() => {
          let m = document.getElementsByClassName('material')[0].offsetHeight + document.getElementsByClassName('header')[0].offsetHeight
          if ((m - document.body.offsetHeight) > 0) {
            window.scrollTo(0, (m - document.body.offsetHeight))
          }
          for (let y of document.getElementsByClassName('material-he')) {
